import React from 'react';
import '../assets/scss/carForm.scss';

function CarForm (props) {
    console.log(props)
    return (
        <div>
            <select name="year" value={props.year} onChange={props.handleChange}>
                {props.vehicle.years.map(year => (
                    <option key={year.id} value={year.name}> {year.name} </option>
                ))}
            </select>
        </div>
    )
}

